import { useDispatch, useSelector} from "react-redux"
import { decrement, increment } from "../redux/Slices/counterslices";



const Counter = () => {
  return (
    <div>
   <button
    onClick={()=>dispatch(increment())}
   >
     Increment
   </button>
   <br/>
   <br/>

   <div>{}</div>

   <br/>
   <br/>
   <button 
   onClick={()=>dispatch(decrement())}
   >
     Decrement
   </button>
   

   </div>

  )
   

};

export default Counter;
